(205, 'Post Card', 'PPO1407', 'ANIMA are Tulisan limited edition playing cards illustrated by Melissa Sunjaya and Sebastien Theraulaz. The four suits correspond to the four classical elements: Air (Hearts) Fire (Spades) Water (Clubs) and Earth (Diamonds). Additionally the deck features two jokers depicted by the artist'' Oracle of the Sacred Catfish and two special Anima cards portrayed by their Supreme Hippocampus. While ANIMA cards are perfect for playing traditional card games divination and storytelling they are also excellent for crafting whimsical gift tags secret notes or special reminders.', '', '', '', 10, 0, NULL, NULL, 0, 0, 'admin@tulisan.com', '2017-12-14 10:55:46', 'aryaputra@tulisan.com', '2017-12-17 22:21:19'),
(206, 'Playing Card', '', 'ANIMA are Tulisan limited edition playing cards illustrated by Melissa Sunjaya and Sebastien Theraulaz. The four suits correspond to the four classical elements: Air (Hearts) Fire (Spades) Water (Clubs) and Earth (Diamonds). Additionally the deck features two jokers depicted by the artist'' Oracle of the Sacred Catfish and two special Anima cards portrayed by their Supreme Hippocampus. While ANIMA cards are perfect for playing traditional card games divination and storytelling they are also excellent for crafting whimsical gift tags secret notes or special reminders.\r\n', 'Coated card stock with matte laminating finish.\r\n', '5.5 cm x 9.5 cm', '', 10, 4, NULL, NULL, 1, 0, 'admin@tulisan.com', '2017-12-14 10:56:41', 'aryaputra@tulisan.com', '2017-12-30 08:21:52'),
(207, 'Bio Fantasy Books', '', 'Bio Fantasy presents: the complete poetry by Chairil Anwar with 75 accompanying abstract artworks by Melissa Sunjaya. Hand-lettered excerpts of Chairil Anwar''s poetry which are secretly embedded in these work of art can only be viewed with provided red film lens. Active interactions of the audience who viewed the Bio Fantasy artworks with the provided red film lens unveils another form of meaning about ''sense poetry''.', '180 coloured pages hard cover with stitched binding Finished with gold de-bossed title\r\n', '176 x 250 x 17 mm', '', 17, 4, NULL, NULL, 1, 0, 'admin@tulisan.com', '2017-12-14 10:58:24', 'aryaputra@tulisan.com', '2017-12-30 08:26:13'),
